import React, { useState, useEffect } from "react";
import { Grid, IconButton, Paper, TextField, Typography } from "@mui/material";

import AddIcon from "@mui/icons-material/Add";
import RemoveIcon from "@mui/icons-material/Remove";
import { ApiService } from "../Services/ApiService";

const MemberBillingDetails = ({ formData, setFormData, agreementNumber,  }) => {
  const [memberData, setMemberData] = useState([]);

  useEffect(() => {
    fetchMemberBillingDetails(agreementNumber);
  }, [agreementNumber]);

  const fetchMemberBillingDetails = async (agreementNumber) => {
    try {
      const memberBillingData = await ApiService.fetchMemberBillingDetails(agreementNumber);
      setMemberData(memberBillingData);
    } catch (error) {
      console.error("Error fetching member billing details:", error);
    }
  };

  const handleInputChange = (e, index) => {
    const { name, value } = e.target;
    const updatedData = [...memberData];
    updatedData[index][name] = value;
    setMemberData(updatedData);
  };

  const onAddMember = () => {
    setMemberData([...memberData, { level: "", members: "", pricing: "" }]);
  };

  const onRemoveMember = (index) => {
    const updatedMemberData = [...memberData];
    updatedMemberData.splice(index, 1);
    setMemberData(updatedMemberData);
  };

  return (
    <Paper elevation={3} style={{ padding: "5px", margin: "5px" }}>
      <div
        style={{ display: "flex", alignItems: "center", marginBottom: "5px" }}
      >
        <div style={{ flex: 1, backgroundColor: "#93014A", height: "3px" }} />
        <p style={{ margin: "0 10px", fontSize: "20px" }}>Billing Details</p>
        <div style={{ flex: 1, backgroundColor: "#93014A", height: "3px" }} />
      </div>

      <Grid item xs={3.5} marginTop={1.5}>
        <Typography variant="body1">Service Cost Details</Typography>
      </Grid>

      {memberData.map((member, index) => (
        <Grid
          container
          spacing={1}
          key={index}
          marginTop={0.001}
          marginLeft={2}
        >
          <Grid item xs={3.5}>
            <TextField
              label={`Level`}
              type="number"
              name="level"
              value={member.level}
              onChange={(e) => handleInputChange(e, index)}
              fullWidth
            />
          </Grid>
          <Grid item xs={3.5}>
            <TextField
              label={`Members`}
              type="number"
              name="members"
              value={member.members}
              onChange={(e) => handleInputChange(e, index)}
              fullWidth
            />
          </Grid>
          <Grid item xs={3.5}>
            <TextField
              label={`Pricing (â‚¬)`}
              type="number"
              name="pricing"
              value={member.pricing}
              onChange={(e) => handleInputChange(e, index)}
              fullWidth
            />
          </Grid>

          <Grid item xs={0.5}>
            <IconButton
              color="error"
              onClick={() => onRemoveMember(index)}
              disabled={memberData.length === 1}
              style={{
                backgroundColor: "Background",
                borderRadius: "50%",
                width: "26px",
                height: "26px",
                padding: "0",
                marginTop: "15px",
                marginLeft: "10px",
              }}
            >
              <RemoveIcon />
            </IconButton>
          </Grid>

          <Grid item xs={0.5}>
            <IconButton
              color="primary"
              startIcon={<AddIcon />}
              onClick={onAddMember}
              style={{
                backgroundColor: "Background",
                borderRadius: "50%",
                width: "26px",
                height: "26px",
                padding: "0",
                marginTop: "15px",
                marginLeft: "5px",
              }}
            >
              <AddIcon />
            </IconButton>
          </Grid>
        </Grid>
      ))}

      {/* Miscellaneous Cost Details */}
      {/* Add your miscellaneous cost details here */}
    </Paper>
  );
};

export default MemberBillingDetails;
